// BARRE DE NAV


import PersonIcon from '@mui/icons-material/Person';
import HomeIcon from '@mui/icons-material/Home';
import SentimentSatisfiedAltIcon from '@mui/icons-material/SentimentSatisfiedAlt';
import { Button } from "@mui/material";
import { Link } from "react-router-dom";
import { useCookies } from 'react-cookie';
import React, { useState, useEffect } from "react";
import { useHistory } from 'react-router-dom';


export default function Header(props) {
  const history = useHistory()
  const [cookies, setCookies, removeCookies] = useCookies(["token"])
  const tokens = cookies.token
  const [connected, setConnected] = useState(false)
// pour modifier la nave barre pour affficher profil et deconnexion
  useEffect(async () => {
    try {

      if (tokens) {
        setConnected(true)
        props.under("go")

      }
    } catch (error) {
      console.log(error)


    }
  }, [])
  const logout = async () => {
    removeCookies("token", { path: "/" })

  }
  if (connected === true) {
    return (
      <div>
        
        <div style={{ backgroundColor: "#FFF56E", display: "flex", justifyContent: "space-between", marginBottom: "-25px" }}>
          <Link to="/" style={{ color: "inherit", textDecoration: "none" }}>
            <img
              src={"/Logo_plants.png"}
              alt="Logo Myflowerlife"
              style={{ width: "200px", height: "55px", marginLeft: "20px" }}
              href="/home"
            />
          </Link>

          <Button startIcon={<HomeIcon />} style={{ fontSize: "large", color: "#4C9A62", fontFamily: "Lust Regular" }} href="/home">ACCUEIL</Button>
          <Button startIcon={<SentimentSatisfiedAltIcon />} style={{ fontSize: "large", color: "#4C9A62", fontFamily: "Lust Regular" }} href="/story">NOTRE HISTOIRE</Button>
          <Button style={{ fontSize: "large", color: "#4C9A62", fontFamily: "Lust Regular" }} href="/contact">CONTACT</Button>
          <Button style={{ fontSize: "large", color: "#4C9A62", fontFamily: "Lust Regular" }} href="/faq">FAQ</Button>
          <Button startIcon={<PersonIcon />} style={{ boxShadow: "1px 1px 1px black", fontSize: "large", color: "#4C9A62", borderRadius: "45px", backgroundColor: "#FFF752", border: "none", marginTop: "10px", height: "35px", width: "12%", fontFamily: "Lust Regular" }} href="/inscription">INSCRIPTION</Button>
          <Button style={{ fontSize: "large", color: "#4C9A62", fontFamily: "Lust Regular"}} onClick={logout} href="/connexion">Deconnexion</Button>
          <Button style={{ fontSize: "large", color: "#4C9A62", fontFamily: "Lust Regular" }} href="/profil">Profil</Button>



        </div>
      </div>
    );
  } else {
    return (
      <div>
        <div style={{ backgroundColor: "#FFF56E", display: "flex", justifyContent: "space-between", marginBottom: "-25px" }}>
          <Link to="/" style={{ color: "inherit", textDecoration: "none" }}>
            <img
              src={"/logo_plants.png"}
              alt="Logo Myflowerlife"
              style={{ width: "200px", height: "55px", marginLeft: "20px" }}
              href="/home"
            />
          </Link>

          <Button startIcon={<HomeIcon />} style={{ fontSize: "large", color: "#4C9A62", fontFamily: "Lust Regular" }} href="/home">ACCUEIL</Button>
          <Button startIcon={<SentimentSatisfiedAltIcon />} style={{ fontSize: "large", color: "#4C9A62", fontFamily: "Lust Regular" }} href="/story">NOTRE HISTOIRE</Button>
          <Button style={{ fontSize: "large", color: "#4C9A62", fontFamily: "Lust Regular" }} href="/contact">CONTACT</Button>
          <Button style={{ fontSize: "large", color: "#4C9A62", fontFamily: "Lust Regular" }} href="/faq">FAQ</Button>
          <Button startIcon={<PersonIcon />} style={{ boxShadow: "1px 1px 1px black", fontSize: "large", color: "#4C9A62", borderRadius: "45px", backgroundColor: "#FFF752", border: "none", marginTop: "10px", height: "35px", width: "12%", fontFamily: "Lust Regalar" }} href="/inscription">INSCRIPTION</Button>
          <Button style={{ fontSize: "large", color: "#4C9A62", fontFamily: "Lust Regular" }} href="/connexion">CONNEXION</Button>




        </div>
      </div>
    );
  }

}
